import React, { Component } from "react";

import './Profile.css';

export default class Profile extends Component {
    render() {
        return (
            <div className="login">
                <div className="container">
                    <div className="row">
                        <div className="col-12">
                            <div className="login-inner">
                                <a href="#">LOGIN</a>
                                <a href="#">SIGN IN</a>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
